(530, 'Punisher', 'https://www.superherodb.com/pictures2/portraits/10/100/112.jpg', 69, 16, 21, 45, 42, 100, 'Frank Castle', 'Queens, New York', 'Marvel Comics', 'good', 'AMAZING SPIDER-MAN #129', 'Male', 'Human', '183 cm', '90 kg', 'Blue', 'Black', 'Former United States Marine turned professional vigilante', 'The character is an Italian-American vigilante who employs murder, kidnapping, extortion, coercion, threats of violence, and torture in his campaign against crime. Driven by the deaths of his wife and two children, who were killed by the mob for witnessing a killing in New York City\'s Central Park, the Punisher wages a one-man war on crime while employing the use of various weapons and firearms. His family\'s killers were the first to be slain. A war veteran and a United States Marine Corps Scout Sniper in Force Recon, Castle is skilled in hand-to-hand combat, guerrilla warfare, and marksmanship.'),
